import React, { useState } from "react";
import NavBarComp from "../../components/homepage/NavBarComp";
import Button from "react-bootstrap/Button";
import FloatingLabel from "react-bootstrap/FloatingLabel";
import Form from "react-bootstrap"
import "../../styles/pageStyles/testDashStyle.css";
import MakeNewKeysAPI from "../../api/MakeNewKeysAPI.jsx";
export default props => {
    const [keyPair, setKeyPair] = useState([])

    const generateNewKeys = (res) => {
        setKeyPair(res);
        console.log("this is the response: ", keyPair)
    }
    return (
        <>
            <div className="testdashwrap">
                <div className="testdashtopfill">
                    <h1>Welcome, guest!</h1>
                    <FloatingLabel
                        controlId="floatingInput"
                        label="Email address"
                        className="mb-3">
                        <Form.Control type="email" placeholder="name@example.com" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Password">
                        <Form.Control type="password" placeholder="Password" />
                    </FloatingLabel>
                </div>

                <NavBarComp />
                <div className="testusercard">
                    <h2>[Username] [email]</h2>

                </div>
                <div className="addresses">

                </div>
                <div className="generateNewKeyPair">
                    {/* {keyPair} */}
                    <MakeNewKeysAPI response={generateNewKeys} />
                </div>

            </div>
        </>
    )
}
